local Library = loadstring(game:HttpGet("https://raw.githubusercontent.com/xHeptc/Kavo-UI-Library/main/source.lua"))()
local Window = Library.CreateLib("NIGHTMARE TROLLING GUI", "Synapse")
-- Tabs
local Localplayer = Window:NewTab("Localplayer")
local TROLLS = Window:NewTab("TROLLS")

-- Sections
local SpeedNJump = Localplayer:NewSection("Speed, Jumppower and Health")
local Trolls = TROLLS:NewSection("Trolls")

-- Sliders
SpeedNJump:NewSlider("WalkSpeed", "", 500, 0, function(s) -- 500 (MaxValue) | 0 (MinValue)
    game.Players.LocalPlayer.Character.Humanoid.WalkSpeed = s
end)
SpeedNJump:NewSlider("Jumppower", "", 500, 0, function(s) -- 500 (MaxValue) | 0 (MinValue)
    game.Players.LocalPlayer.Character.Humanoid.JumpPower = s
end)
SpeedNJump:NewSlider("Health", "", 500, 0, function(s) -- 500 (MaxValue) | 0 (MinValue)
    game.Players.LocalPlayer.Character.Humanoid.Health = s
end)
-- Buttons
Trolls:NewButton("PP READ INFO", "R6 REQUIRED", function()
 loadstring(game:HttpGet("https://raw.githubusercontent.com/Blitzedzz/NIGHTMAREHUB/main/PPSCRIPT.lua", true))()
 end)
